import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faShoppingCart } from '@fortawesome/free-solid-svg-icons';
import '.../css/Header.css';

function Header(props) {
  return (
    <header className="header navbar navbar-expand-lg navbar-light bg-light">
      <a className="navbar-brand" href="/">
        <img src="logo.png" alt="Logo de la marca" />
      </a>
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse justify-content-end" id="navbarNav">
        <ul className="navbar-nav">
          <li className="nav-item">
            <button className="btn btn-link" onClick={() => window.location.href='/'}>
              Volver a inicio
            </button>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              <FontAwesomeIcon icon={faShoppingCart} />
              <span className="cart-count">{props.cartCount}</span>
            </a>
          </li>
        </ul>
      </div>
    </header>
  );
}

export default Header;
